      <tr>
        <th>CompSany</th>
        <th>Contact</th>
        <th>Country</th>
      </tr>
      <tr>
        <td>{item.sno}</td>
        <td>{item.name}</td>
        <td>{item.email}</td>
      </tr>
    </table>
     ))}


    </>
  )

};

export default Home;
